// import Edit from "./Components/Restaurants/Edit";

function App() {
  return (
    <div className="App">
    <h1 className="geeks">Restaurants CRUD </h1>
    <Router>
        <Routes>
            <Route path="/" element={<List />} />
            <Route path="/create" element={<Create />} />
            <Route path="/edit" element={<Edit />} />
        </Routes>
    </Router>
</div>
  );
}

export default App;
